import styled from "styled-components";

const Chart = styled.div``;
function CustomerChart(props) {
  const data = [{ FirstName: "Bob", LastName: "Dylan", Phone: "9095550123" }];

  const makeRowsFromData = (rowData) => {
    let fullName = `${rowData.FirstName} ${rowData.LastName}`;

    return (
      <>
        <tr>
          <td>{fullName}</td>
          <td>{rowData.Phone}}</td>
          <td>{rowData.Email}</td>
        </tr>
      </>
    );
  };

  return (
    <>
      <Chart>
        <h2>Customer Chart</h2>
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Phone</th>
              <th>Email</th>
            </tr>
          </thead>
          <tbody>{data.map((row) => makeRowsFromData(row))}</tbody>
        </table>
      </Chart>
    </>
  );
}

export default CustomerChart;
